import React from "react";
import './transport.css';
import jsonData from '../transportJSON.json'; 

const Transport = () => {
  // Initialize an empty array to hold JSX elements
  let travelersList = [];

  // Iterate over the JSON data using a for loop
  for (let i = 0; i < jsonData.length; i++) {
    const item = jsonData[i];
    // Push JSX elements into the array
    travelersList.push(
      <div key={i}> 
        <h2>{item.name}</h2>
        <p>{item.description}</p>
      </div>
    );
  }

  return (
    <div className="middle_transport">
      <div className="container_transport">
        <div className="con1">
          <div>
            <center>
              <h1>Bus Enquire</h1>
            </center>
            <form>
              <center>
                <input type="date" id="travelDate" placeholder="Date" />
              </center>
              <center>
                <select id="from" name="from">
                  <option value="">Select Departure</option>
                </select>

                <span id="reverse">&#8596;</span>

                <select id="to" name="to">
                  <option value="">Select Destination</option>
                </select>
              </center>
              <center>
                <button type="button" id="searchButton">Search Buses</button>
              </center>
            </form>
          </div>
          <div id="busList">
            {/* Render the array of JSX elements */}
            {travelersList}
          </div>
          <div id="error-message"></div>
        </div>
        <div className="con2">
          <img src="https://upload.wikimedia.org/wikipedia/commons/8/8a/YX68ULW.jpg" alt="Bus" />
        </div>
      </div>
    </div>
  );
};

export default Transport;
